function info_show() {
if($("#popup_piston").classList.contains("none") || $("#popup_circuit").classList.contains("none") || $("#popup_sensor").classList.contains("none") || $("#popup_demonstrate").classList.contains("none") || $("#popup_ball").classList.contains("none") || $("#popup_rest").classList.contains("none") || $("#popup_fixed").classList.contains("none") || $("#popup_carbide").classList.contains("none") || $("#popup_catch").classList.contains("none") || $("#popup_inlet").classList.contains("none") || $("#popup_int_check").classList.contains("none") || $("#popup_outlet").classList.contains("none") || $("#popup_stem").classList.contains("none")) {
  $("#popup_piston").classList.remove("none");
  $("#popup_circuit").classList.remove("none");
  $("#popup_sensor").classList.remove("none");
  $("#popup_demonstrate").classList.remove("none");
  $("#popup_ball").classList.remove("none");
  $("#popup_rest").classList.remove("none");
  $("#popup_fixed").classList.remove("none");
  $("#popup_carbide").classList.remove("none");
  $("#popup_catch").classList.remove("none");
  $("#popup_inlet").classList.remove("none");
  $("#popup_int_check").classList.remove("none");
  $("#popup_outlet").classList.remove("none");
  $("#popup_stem").classList.remove("none");
  setTimeout(function(){
    $("#popup_piston").classList.remove("invis");
    $("#popup_circuit").classList.remove("invis");
    $("#popup_sensor").classList.remove("invis");
    $("#popup_demonstrate").classList.remove("invis");
    $("#popup_ball").classList.remove("invis");
    $("#popup_rest").classList.remove("invis");
    $("#popup_fixed").classList.remove("invis");
    $("#popup_carbide").classList.remove("invis");
    $("#popup_catch").classList.remove("invis");
    $("#popup_inlet").classList.remove("invis");
    $("#popup_int_check").classList.remove("invis");
    $("#popup_outlet").classList.remove("invis");
    $("#popup_stem").classList.remove("invis");
  }, 40);
} else {
  $("#popup_piston").classList.toggle("invis");
  $("#popup_circuit").classList.toggle("invis");
  $("#popup_sensor").classList.toggle("invis");
  $("#popup_demonstrate").classList.toggle("invis");
  $("#popup_ball").classList.toggle("invis");
  $("#popup_rest").classList.toggle("invis");
  $("#popup_fixed").classList.toggle("invis");
  $("#popup_carbide").classList.toggle("invis");
  $("#popup_catch").classList.toggle("invis");
  $("#popup_inlet").classList.toggle("invis");
  $("#popup_int_check").classList.toggle("invis");
  $("#popup_outlet").classList.toggle("invis");
  $("#popup_stem").classList.toggle("invis");
  setTimeout(function(){
    $("#popup_piston").classList.toggle("none");
    $("#popup_circuit").classList.toggle("none");
    $("#popup_sensor").classList.toggle("none");
    $("#popup_demonstrate").classList.toggle("none");
    $("#popup_ball").classList.toggle("none");
    $("#popup_rest").classList.toggle("none");
    $("#popup_fixed").classList.toggle("none");
    $("#popup_carbide").classList.toggle("none");
    $("#popup_catch").classList.toggle("none");
    $("#popup_inlet").classList.toggle("none");
    $("#popup_int_check").classList.toggle("none");
    $("#popup_outlet").classList.toggle("none");
    $("#popup_stem").classList.toggle("none");
  }, 100);
  }
}

$("#info").onclick = function() {
  info_show();
}

setTimeout(function(){
  info_show();
}, 400);


function gw_upd() {
  g_angle = t_angle * 3;
  w_angle = t_angle * 2.35;

  if(r_angle > y_angle) {
    $("#popup_warn").classList.add("invis");
    setTimeout(function(){$("#popup_warn").classList.add("none")}, 100);
  }

  $("#gray_arrow").setAttribute("transform", "rotate(" + (g_angle - 150) + " 708.719 880.397)");
  $("#white_arrow").setAttribute("transform", "rotate(" + (w_angle - 150) + " 1748.044 763.201)");

  $("#red_label").textContent = "- " + r_angle + " (BAR)";
  $("#yellow_label").textContent = "- " + y_angle + " (BAR)";
  $("#gray_label").textContent = "- " + (g_angle / 30).toFixed(2) + " (BAR)";
  $("#white_label").textContent = "- " + (w_angle / 5).toFixed(2) + " (LPD)";

  if (w_angle > 1 && r_angle > 0 && y_angle < r_angle) {
    if(allow_play) {
      animation_id = requestAnimationFrame(animate);
    }
    allow_play = false;
  } else {
    $("#gray_arrow").setAttribute("transform", "rotate(-150 708.719 880.397)");
    $("#white_arrow").setAttribute("transform", "rotate(-150 1748.044 763.201)");
    if(y_angle >= r_angle) {
      $("#popup_warn").classList.remove("invis");
      setTimeout(function(){$("#popup_warn").classList.remove("none")}, 100);
    }
    cancelAnimationFrame(animation_id);
    allow_play = true;
  }

  $("#restrictor_left").setAttribute("transform", "translate(" + w_angle / 5 * -0.234 + " 0)");
  $("#restrictor_right").setAttribute("transform", "translate(" + w_angle / 5 * 0.234 + " 0)");
  $("#piston_left_spring").setAttribute("transform", "translate(962 340.23) scale(1 " + (1 - w_angle / 2000) + ") translate(-962 -340.23)");
  $("#piston_left").setAttribute("transform", "translate(0 " + w_angle / 2.5 * -0.234 + ")");
}

function rarr_dwn() {
  if(r_angle > 0 && r_angle > y_angle) {
    r_angle -= 5;
    $("#red_arrow").setAttribute("transform", "rotate(" + (r_angle - 150) + " 171.933 434.709)");
  }
  gw_upd();
}

function rarr_up() {
  if(r_angle < 300) {
    r_angle += 5;
    $("#red_arrow").setAttribute("transform", "rotate(" + (r_angle - 150) + " 171.933 434.709)");
  }
  gw_upd();
}

function yarr_dwn() {
  if(y_angle > 0) {
    y_angle -= 5;
    $("#yellow_arrow").setAttribute("transform", "rotate(" + (y_angle - 150) + " 1455.102 434.729)");
  }
  gw_upd();
}

function yarr_up() {
  if(y_angle < 300 && r_angle > y_angle) {
    y_angle += 5;
    $("#yellow_arrow").setAttribute("transform", "rotate(" + (y_angle - 150) + " 1455.102 434.729)");
  }
  gw_upd();
}

function tgl_dwn() {
  if(t_angle > 0) {
    t_angle -= 2;
    $("#toggle_arrow").setAttribute("transform", "rotate(" + ((100 - t_angle) * 1.8 - 180) + " 1143.412 408.396)");
  }
  gw_upd();
}

function tgl_up() {
  if(t_angle < 100) {
    t_angle += 2;
    $("#toggle_arrow").setAttribute("transform", "rotate(" + ((100 - t_angle) * 1.8 - 180) + " 1143.412 408.396)");
  }
  gw_upd();
}

$("#rb_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_dwn()}, 200);
}
$("#rb_left").onclick = function() {rarr_dwn()};
$("#rb_left").onmouseup = function() {
  clearInterval(setint);
  clearInterval(setint2);
  start_oscillate_up();
  $("#popup_react").classList.remove("none");
  setTimeout(function(){$("#popup_react").classList.remove("invis")}, 100);
};

$("#rb_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){rarr_up()}, 200);
}
$("#rb_right").onclick = function() {rarr_up()};
$("#rb_right").onmouseup = function() {
  clearInterval(setint);
  clearInterval(setint2);
  start_oscillate_down();
  $("#popup_react").classList.remove("none");
  setTimeout(function(){$("#popup_react").classList.remove("invis")}, 100);
};

$("#tgl_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){tgl_up()}, 200);
}
$("#tgl_left").onclick = function() {tgl_up()};

$("#tgl_right").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){tgl_dwn()}, 200);
}
$("#tgl_right").onclick = function() {tgl_dwn()};

$("#yb_left").onmousedown = function() {
  clearInterval(setint);
  setint = setInterval(function(){yarr_dwn()}, 200);
}
$("#yb_left").onclick = function() {yarr_dwn()};
$("#yb_left").onmouseup = function() {
