}
$("#yb_right").onclick = function() {yarr_up()};
$("#yb_right").onmouseup = function() {
  clearInterval(setint);
  clearInterval(setint2);
  start_oscillate_down();
  $("#popup_react").classList.remove("none");
  setTimeout(function(){$("#popup_react").classList.remove("invis")}, 100);
};

window.onmouseup = function() {clearInterval(setint)};

function oscillate_up() {
  if(osc_iter > 0) {
    osc_iter--;
    if(osc_iter >= 10) {
      osc_pos++;
      $("#big-spring").setAttribute("transform", "translate(1172.62 634.68) scale(1 " + (1 - osc_iter / 100) + ") translate(-1172.62 -634.68)");
      $("#inner-spring").setAttribute("transform", "translate(1172.62 634.68) scale(1 " + (1 - osc_iter / 130) + ") translate(-1172.62 -634.68)");
      $("#piston_move").setAttribute("transform", "translate(0 " + (osc_iter * -.5) + ")");
    } else {
      osc_pos--;
      $("#big-spring").setAttribute("transform", "translate(1172.62 634.68) scale(1 " + (1 - osc_iter / 100) + ") translate(-1172.62 -634.68)");
      $("#inner-spring").setAttribute("transform", "translate(1172.62 634.68) scale(1 " + (1 - osc_iter / 130) + ") translate(-1172.62 -634.68)");
      $("#piston_move").setAttribute("transform", "translate(0 " + (osc_iter * -.5) + ")");
    }
  } else {
    clearInterval(setint2);
    osc_iter = 20;
    setTimeout(function(){
      $("#popup_react").classList.add("invis");
      setTimeout(function(){$("#popup_react").classList.add("none")}, 100);
    }, 300);
  }
}

function oscillate_down() {
  if(osc_iter > 0) {
    osc_iter--;
    if(osc_iter >= 10) {
      osc_pos++;
      $("#big-spring").setAttribute("transform", "translate(1172.62 634.68) scale(1 " + (1 + osc_iter / 100) + ") translate(-1172.62 -634.68)");
      $("#inner-spring").setAttribute("transform", "translate(0 " + (osc_iter * .5) + ")");
      $("#piston_move").setAttribute("transform", "translate(0 " + (osc_iter * .5) + ")");
      $("#piston_body").setAttribute("transform", "translate(0 " + (osc_iter * .5) + ")");
    } else {
      osc_pos--;
      $("#big-spring").setAttribute("transform", "translate(1172.62 634.68) scale(1 " + (1 + osc_iter / 100) + ") translate(-1172.62 -634.68)");
      $("#inner-spring").setAttribute("transform", "translate(0 " + (osc_iter * .5) + ")");
      $("#piston_move").setAttribute("transform", "translate(0 " + (osc_iter * .5) + ")");
      $("#piston_body").setAttribute("transform", "translate(0 " + (osc_iter * .5) + ")");
    }
  } else {
    clearInterval(setint2);
    osc_iter = 20;
    setTimeout(function(){
      $("#popup_react").classList.add("invis");
      setTimeout(function(){$("#popup_react").classList.add("none")}, 100);
    }, 300);
  }
}

function start_oscillate_up() {
  clearInterval(setint2);
  setint2 = setInterval(function(){oscillate_up()}, 10);
}

function start_oscillate_down() {
  clearInterval(setint2);
  setint2 = setInterval(function(){oscillate_down()}, 10);
}

$("#zoom_close").onclick = function() {
  $("#zoom_clip").setAttribute("clip-path", "");
  $("#zoom").setAttribute("transform", "");
  $("#zoom_hide").classList.remove("active");
  $("#zoom").classList.remove("active");
  $("#zoom_frame").classList.add("invis");
  $("#zoom_01").classList.toggle("invis");
  $("#zoom_02").classList.toggle("invis");
  $("#zoom_03").classList.toggle("invis");
};

$("#zoom_01").onclick = function() {
  $("#zoom_clip").setAttribute("clip-path", "url(#zoom_clp)");
  $("#zoom").setAttribute("transform", "translate(1400 540) scale(2) translate(-1400 -540)");
  $("#zoom").classList.add("active");
  $("#zoom_hide").classList.add("active");
  $("#zoom_frame").classList.remove("invis");
  $("#zoom_01").classList.toggle("invis");
  $("#zoom_02").classList.toggle("invis");
  $("#zoom_03").classList.toggle("invis");
}
$("#zoom_02").onclick = function() {
  $("#zoom_clip").setAttribute("clip-path", "url(#zoom_clp)");
  $("#zoom").setAttribute("transform", "translate(780 270) scale(2.1) translate(-780 -270)");
  $("#zoom").classList.add("active");
  $("#zoom_hide").classList.add("active");
  $("#zoom_frame").classList.remove("invis");
  $("#zoom_01").classList.toggle("invis");
  $("#zoom_02").classList.toggle("invis");
  $("#zoom_03").classList.toggle("invis");
}
$("#zoom_03").onclick = function() {
  $("#zoom_clip").setAttribute("clip-path", "url(#zoom_clp)");
  $("#zoom").setAttribute("transform", "translate(1280 650) scale(3) translate(-1280 -650)");
  $("#zoom").classList.add("active");
  $("#zoom_hide").classList.add("active");
  $("#zoom_frame").classList.remove("invis");
  $("#zoom_01").classList.toggle("invis");
  $("#zoom_02").classList.toggle("invis");
  $("#zoom_03").classList.toggle("invis");
}

function animate() {
  if(arrows_shift < 40) {
    arrows_shift += w_angle / 100;
    $("#q_01").setAttribute("transform", "translate(0 " + arrows_shift * -0.75 + ")");
    $("#q_02").setAttribute("transform", "translate(" + arrows_shift * -0.5 + " 0)");
    $("#q_03").setAttribute("transform", "translate(" + arrows_shift * 0.5 + " 0)");
    $("#q_04").setAttribute("transform", "translate(0 " + arrows_shift * -0.5 + ")");
    $("#q_05").setAttribute("transform", "translate(" + arrows_shift * 0.25 + " 0)");
    $("#q_06").setAttribute("transform", "translate(" + arrows_shift * -0.25 + " 0)");
    $("#q_07").setAttribute("transform", "translate(0 " + arrows_shift * -1.25 + ")");
    $("#q_08").setAttribute("transform", "translate(" + arrows_shift * -1.25 + " 0)");
    $("#q_09").setAttribute("transform", "translate(0 " + arrows_shift * 1.25 + ")");
    $("#q_10").setAttribute("transform", "translate(" + arrows_shift * -0.5 + " 0)");
    $("#q_11").setAttribute("transform", "translate(" + arrows_shift * -0.978 + " " + arrows_shift * 0.778 + ")");
    $("#q_12").setAttribute("transform", "translate(0 " + arrows_shift * -1.25 + ")");
    $("#q_13").setAttribute("transform", "translate(" + arrows_shift * -1.25 + " 0)");
    $("#q_14").setAttribute("transform", "translate(0 " + arrows_shift * 1.25 + ")");
    $("#q_15").setAttribute("transform", "translate(0 " + arrows_shift * 0.75 + ")");
  } else {
    arrows_shift = 1;
  }
    animation_id = requestAnimationFrame(animate);
}
